    for i in range(len(sequence) - 1, 0, -1):
        if sequence[i] < sequence[i - 1]:
            for j in range(len(sequence) - 1, i - 1, -1):
                if sequence[j] < sequence[i - 1]:
                    return {'index': i - -1, 'swap_with': j}
    return {'index': -1, 'swap_with': -1}
